import React, { Fragment } from 'react';
import styles from './Header.module.css';
import mealsImage from '../../assets/meals.jpg';
import HeaderCartButton from './HeaderCartButton';
const Header = props => {
  return (
    <Fragment>
      <header className={styles.header}>
        <h1>React Meals</h1>
        <div class="dropdown"><button aria-haspopup="true" aria-expanded="false" type="button" class="dropdown-toggle btn btn-success"><svg stroke="currentColor" fill="currentColor" stroke-width="0" viewBox="0 0 576 512" color="white" font-size="25px" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg" style="color: white;"><path d="M528.12 301.319l47.273-208C578.806 78.301 567.391 64 551.99 64H159.208l-9.166-44.81C147.758 8.021 137.93 0 126.529 0H24C10.745 0 0 10.745 0 24v16c0 13.255 10.745 24 24 24h69.883l70.248 343.435C147.325 417.1 136 435.222 136 456c0 30.928 25.072 56 56 56s56-25.072 56-56c0-15.674-6.447-29.835-16.824-40h209.647C430.447 426.165 424 440.326 424 456c0 30.928 25.072 56 56 56s56-25.072 56-56c0-22.172-12.888-41.332-31.579-50.405l5.517-24.276c3.413-15.018-8.002-29.319-23.403-29.319H218.117l-6.545-32h293.145c11.206 0 20.92-7.754 23.403-18.681z"></path></svg><span class="badge">1</span></button><div aria-labelledby="" class="dropdown-menu dropdown-menu-right" style="min-width: 370px; margin: 0px;"><span class="cartitem"><img src="http://placeimg.com/640/480/abstract" class="cartItemImg" alt="Refined Granite Bike" /><div class="cartItemDetail"><span>Refined Granite Bike</span><span>₹ 856</span></div><svg stroke="currentColor" fill="currentColor" stroke-width="0" viewBox="0 0 1024 1024" font-size="20px" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg" style="cursor: pointer;"><path d="M864 256H736v-80c0-35.3-28.7-64-64-64H352c-35.3 0-64 28.7-64 64v80H160c-17.7 0-32 14.3-32 32v32c0 4.4 3.6 8 8 8h60.4l24.7 523c1.6 34.1 29.8 61 63.9 61h454c34.2 0 62.3-26.8 63.9-61l24.7-523H888c4.4 0 8-3.6 8-8v-32c0-17.7-14.3-32-32-32zm-200 0H360v-72h304v72z"></path></svg></span><a href="/cart"><button type="button" class="btn btn-primary" style="width: 95%; margin: 0px 10px;">Go To Cart</button></a></div></div>
        <HeaderCartButton onClick={props.onShowCart} />
      </header>
      <div className={styles.main__image}>
        <img src={mealsImage} alt='A table full of delicious food!' />
      </div>
    </Fragment>
  );
};
export default Header;
